import React from "react";
import { Button, Col, FormCheck, Stack } from "react-bootstrap";

const Todo = ({ text }) => {
  return (
    <div>
      <Stack gap={3} direction="horizontal" style={{textAlign: 'center'}}>
        <h3>{text}</h3>

        <FormCheck />
        <Button variant="danger">Delete</Button>
      </Stack>
    </div>
  );
};

export default Todo;
